import './App.scss';
import logo from '../images/logo.png';
import CharacterList from './CharacterList';
import Filter from './Filter';
import Header from './Header';

function App() {
  return (
    <div className="page">
      <Header />
      <main className="main">
        <Filter />
        <CharacterList />
      </main>
    </div>
  );
}

export default App;
